    VALUES(13240, "City Center Hilton", "255 W South Temple ", "", "Salt Lake City", "Utah", " 84101", 2, 40.768922, -111.89850999999999, " 1-801-328-2000", "", "slc.hotelinfo@hilton.com", "  The Hilton Salt Lake City Center hotel is nestled in the downtown business district just eight minutes from the Salt Lake International Airport and across the street from the Salt Palace Convention Center.  Hilton Salt Lake City Center is perfectly situated for business and leisure travelers.  We are within three blocks of more than 60 restaurants and two shopping malls, EnergySolutions Arena (home of the Utah Jazz), historic Temple Square and the Family History Library.     Driving from Salt Lake City International Airport:   The Hilton Salt Lake City Center hotel is located just seven miles from Salt Lake City International Airport, with an approximate drive time of ten minutes.  If you choose to drive from Salt Lake City International Airport, follow signs for I-80 Eastbound (City Center). Take I-80 East and exit at 600 South. Follow 600 South to West Temple (Four lights). Turn left on West Temple and the Hilton Salt Lake City Center hotel is three and a half blocks on the right.  Distance from hotel: 7 miles Drive time: 10 min.  Driving from the South on Interstate 15: Exit I-15 at 600 South, then follow 600 South to West Temple. Turn left on West Temple and the Hilton Salt Lake City Center hotel is three and a half blocks on the right.  Driving from the North on Interstate 15: Exit I-15 at 400 South, then take a left. Follow 400 South to West Temple and turn left on West Temple. The Hilton Salt Lake City Center hotel is one and a half blocks on the right.  Driving from the West on Interstate 80: Follow I-80 as it merges with I-15 Northbound. Exit I-80/I-15 at 600 South. Follow 600 South to West Temple, then turn left on West Temple. The Hilton Salt Lake City Center hotel is three and a half blocks on the right.  Driving from the East, from Interstate 80 West (Wyoming) or from Interstate 70 West (Colorado). Follow as the interstate merges with I-15 Northbound, then exit at 600 South. Follow 600 South to West Temple and then turn left on West Temple. The Hilton Salt Lake City Center hotel is three and a half blocks on the right.", "http://hiltonsaltlakecity.com/", null);
