    VALUES(13600, "Green Springs Inn & Cabins", "11470 Oregon 66", "", "Ashland", "Oregon", "97520", 2, 42.122321, -122.46394399999997, "(541) 890-6435", "", "", "The Green Springs Inn is on State Highway 66 about 17 miles east of Ashland, Oregon, and 45 miles west of Klamath Falls.  From Ashland- Take Exit 14 from Interstate 5. Travel east on Hwy 66 toward Klamath Falls, past Emigrant Lake. Stay on the paved road, which climbs from about milepost 9 to milepost 15. We are located at the Hyatt Lake Access Road turnoff between the 17 and 18 mile markers.  From Klamath Falls- Take the Greenpsprings Highway (Hwy 66) exit from Hwy 97 and drive 45 miles west through Keno.", "http://greenspringsinn.com/", null);
