    VALUES(13604, "Cora Mundo'", "Chemin départementale 64", "BP 91074", "Mundolsheim", "", "67452", 80, 48.6554901675, 7.7244431036, " 03 88 20 96 96", "", "st@cora.fr", "        Depuis Strasbourg :         Emprunter l’A4 en direction de Paris/Haguenau. Prendre la sortie 49 Vendenheim (puis voir plan).         En bus, prendre la ligne 71 (départ : les Halles-Sébastopol) direction Eckwersheim Hippodrome jusqu'à l'arrêt Zone commerciale.         Depuis Vendenheim :         Emprunter la N63 en direction de Strasbourg, au feu à droite puis suivre fléchage (puis voir plan).         En bus, prendre la ligne 71 direction Les Halles-Sébastopol jusqu'à l'arrêt Zone commerciale.         Depuis Reichstett :         Rejoindre la D63 en direction de l’A4 Strasbourg/Paris. Ne pas prendre l’A4, continuer tout droit vers Mundolsheim puis Vendenheim (puis voir plan).", "http://www.cora.fr/strasbourg/", null);
